    false,nt"url": null,nt"notes": "The first scientific objective of this
    study was to determine if various environmental contaminants are having an adverse
    effect on the reproductive success of white pelicans breeding at Anaho Island National
    Wildlife Refuge. The second scientific objective of this study is to determine the
    sources of local contamination. Eggs, blood samples, feathers, and regurgitated
    food were analyzed for organochlorine pesticides and polychlorinated biphenyls (PCBs),
    and trace elements, especially mercury and selenium.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
